// Function to create a card HTML
function createCard(card, cardId) {
    return `
        <div class="card channel-card">   
            <a class="collapsed" data-bs-toggle="collapse" href="#${cardId}">
                <div class="card-header">
                    <h6>${card.title}</h6>
                    <i class="fa-solid fa-caret-right"></i>
                    <i class="fa-solid fa-caret-up" style="display: none;"></i>
                </div>
            </a>
            <div id="${cardId}" class="collapse" data-bs-parent="#${cardId}">
                <div class="channel-name-body">
                    ${card.innerHTML}
                </div>
            </div>
        </div>
    `;
}


cardData.forEach((card, index) => {
    const cardId = `collapse${index + 1}`;
    const cardHTML = createCard(card, cardId);

    if (index % 3 === 0) {
        list1.innerHTML += cardHTML;
    } else if (index % 3 === 1) {
        list2.innerHTML += cardHTML;
    } else {
        list3.innerHTML += cardHTML;
    }
});

